--Anti Aim Functions

--Static AA
local function static() 
      if yawtype:GetValue() == 1 then
         gui.SetValue("rbot.antiaim.yaw", BaseV:GetValue()) 
      end  
end
callbacks.Register( "Draw", static);



--Cycle AA
local function jitterYaw()
if yawtype:GetValue() == 2 then
	maths = (gui.GetValue("Ghost.Base") * math.cos((globals.RealTime()) / (gui.GetValue("Ghost.Delay")*(0.01)))+ gui.GetValue("Ghost.Cycle"));
	gui.SetValue("rbot.antiaim.yaw", maths)
 end
end

callbacks.Register("Draw", jitterYaw);


--Switch AA
local RotationJitter = 10

function SwitchYaw()
 if yawtype:GetValue() == 3 then
   if (RotationJitter == 10) then
        gui.SetValue("rbot.antiaim.yaw", BaseV:GetValue())
        RotationJitter = 11
    elseif (RotationJitter == 11) then
        gui.SetValue("rbot.antiaim.yaw", SecondV:GetValue())
        RotationJitter = 10
        end
  end
end
