--DSwitch AA
local RotationJitter1 = 10

function SwitchYaw2()
 if yawtype:GetValue() == 4 then
   if (RotationJitter1 == 10) then
        gui.SetValue("rbot.antiaim.yaw", BaseV:GetValue())
        RotationJitter1 = 11
    elseif (RotationJitter1 == 11) then
        gui.SetValue("rbot.antiaim.yaw", SecondV:GetValue())
        RotationJitter1 = 12
    elseif (RotationJitter1 == 12) then
        gui.SetValue("rbot.antiaim.yaw", ThirdV:GetValue())
        RotationJitter1 = 13
    elseif (RotationJitter1 == 13) then
        gui.SetValue("rbot.antiaim.yaw", ForthV:GetValue())
        RotationJitter1 = 10
    
        end
  end
end

