--Static Left AA
local function staticLeft() 
      if lefttype:GetValue() == 1 then
         gui.SetValue("rbot.antiaim.desyncleft", BaseVL:GetValue()) 
      end  
end
callbacks.Register( "Draw", staticLeft);


--Swithc AA Left
local RotationJitterL = 10

function SwitchLeft()
 if lefttype:GetValue() == 2 then
   if (RotationJitterL == 10) then
        gui.SetValue("rbot.antiaim.desyncleft", BaseVL:GetValue())
        RotationJitterL = 11
    elseif (RotationJitterL == 11) then
        gui.SetValue("rbot.antiaim.desyncleft", SecondVL:GetValue())
        RotationJitterL = 10
        end
  end
end
callbacks.Register("Draw", SwitchLeft)



--Static Right AA

local function staticRight() 
      if righttype:GetValue() == 1 then
         gui.SetValue("rbot.antiaim.desyncright", BaseVR:GetValue()) 
      end  
end
callbacks.Register( "Draw", staticRight);

--Swithc AA  Right
local RotationJitterR = 10

function SwitchRight()
 if righttype:GetValue() == 2 then
   if (RotationJitterR == 10) then
        gui.SetValue("rbot.antiaim.desyncrightw", BaseVR:GetValue())
        RotationJitterR = 11
    elseif (RotationJitterR == 11) then
        gui.SetValue("rbot.antiaim.desyncright", SecondVR:GetValue())
        RotationJitterR = 10
        end
  end
end
callbacks.Register("Draw", SwitchRight)


--Visual 
local KeyFakeD = gui.GetValue("rbot.antiaim.extra.fakecrouchkey")

function FakeDIn()
draw.SetFont(draw.CreateFont("Tahoma", 20, 700))
local KeyFakeD = gui.GetValue("rbot.antiaim.extra.fakecrouchkey")
 if EnableFakeD:GetValue() then
 
 if input.IsButtonDown(KeyFakeD) then
  draw.Color(62, 222, 83, 255)
  draw.TextShadow(7, YFakeD:GetValue()
, "FakeDuck")
  else
  draw.Color(222, 62, 62, 255)
  draw.TextShadow(7, YFakeD:GetValue()
, "FakeDuck")
  end
 end
end

callbacks.Register("Draw",FakeDIn)

