--Cycle fakelag
local function jitterfakelag()
if FakeLagtype:GetValue() == 2 then
	maths = (gui.GetValue("Ghost.Basef") * math.cos((globals.RealTime()) / (gui.GetValue("Ghost.Delayf")*(0.01)))+ gui.GetValue("Ghost.Cyclef"));
	gui.SetValue("misc.fakelag.factor", maths)
 end
end

callbacks.Register("Draw", jitterfakelag);



--static slowwalk
local function staticfakelag() 
      if SlowWalktype:GetValue() == 1 then
         gui.SetValue("rbot.accuracy.movement.slowspeed", BaseS:GetValue()) 
      end  
end
callbacks.Register( "Draw", staticfakelag);



--Cycle slowwalk
local function jitterslowwalk()
if SlowWalktype:GetValue() == 2 then
	maths = (gui.GetValue("Ghost.Bases") * math.cos((globals.RealTime()) / (gui.GetValue("Ghost.Delays")*(0.01)))+ gui.GetValue("Ghost.Cycles"));
	gui.SetValue("rbot.accuracy.movement.slowspeed", maths)
 end
end

callbacks.Register("Draw", jitterslowwalk);


--Combo Box
function yawcombo()
    
if yawtype:GetValue() == 0 then
BaseV:SetInvisible(true);
CycleV:SetInvisible(true);
Speed:SetInvisible(true);
SecondV:SetInvisible(true);
ThirdV:SetInvisible(true);
ForthV:SetInvisible(true);
        

elseif yawtype:GetValue() == 1 then
BaseV:SetInvisible(false);
CycleV:SetInvisible(true);
Speed:SetInvisible(true);
SecondV:SetInvisible(true);
ThirdV:SetInvisible(true);
ForthV:SetInvisible(true);

elseif yawtype:GetValue() == 2 then

BaseV:SetInvisible(false);
CycleV:SetInvisible(false);
Speed:SetInvisible(false);
SecondV:SetInvisible(true);
ThirdV:SetInvisible(true);
ForthV:SetInvisible(true);

elseif yawtype:GetValue() == 3 then
BaseV:SetInvisible(false);
CycleV:SetInvisible(true);
Speed:SetInvisible(true);
SecondV:SetInvisible(false);
ThirdV:SetInvisible(true);
ForthV:SetInvisible(true);

elseif yawtype:GetValue() == 4 then
BaseV:SetInvisible(false);
CycleV:SetInvisible(true);
Speed:SetInvisible(true);
SecondV:SetInvisible(false);
ThirdV:SetInvisible(false);
ForthV:SetInvisible(false);



end

end

callbacks.Register("Draw",yawcombo);


function leftcombo()
    
if lefttype:GetValue() == 0 then
BaseVL:SetInvisible(true);
SecondVL:SetInvisible(true);

elseif lefttype:GetValue() == 1 then
BaseVL:SetInvisible(false);
SecondVL:SetInvisible(true);

elseif lefttype:GetValue() == 2 then
BaseVL:SetInvisible(false);
SecondVL:SetInvisible(false);

end

end

