function rightcombo()
    
if righttype:GetValue() == 0 then
BaseVR:SetInvisible(true);
SecondVR:SetInvisible(true);

elseif righttype:GetValue() == 1 then
BaseVR:SetInvisible(false);
SecondVR:SetInvisible(true);

elseif righttype:GetValue() == 2 then
BaseVR:SetInvisible(false);
SecondVR:SetInvisible(false);

end
