function fakelagcombo()
    
if FakeLagtype:GetValue() == 0 then
BaseF:SetInvisible(true);
CycleF:SetInvisible(true);
SpeedF:SetInvisible(true);




elseif FakeLagtype:GetValue() == 1 then
BaseF:SetInvisible(false);
CycleF:SetInvisible(true);
SpeedF:SetInvisible(true);

elseif FakeLagtype:GetValue() == 2 then
BaseF:SetInvisible(false);
CycleF:SetInvisible(false);
SpeedF:SetInvisible(false);


end 

end

callbacks.Register("Draw",fakelagcombo);


function slowwalkcombo()
    
if SlowWalktype:GetValue() == 0 then
BaseS:SetInvisible(true);
CycleS:SetInvisible(true);
SpeedS:SetInvisible(true);




elseif SlowWalktype:GetValue() == 1 then
BaseS:SetInvisible(false);
CycleS:SetInvisible(true);
SpeedS:SetInvisible(true);

elseif SlowWalktype:GetValue() == 2 then
BaseS:SetInvisible(false);
CycleS:SetInvisible(false);
SpeedS:SetInvisible(false);


end 

end

callbacks.Register("Draw",slowwalkcombo);

